import React, { useState } from 'react';


function App() {
    const [inputName, setInputName] = useState("");
    const [name, setName] = useState();

    const InputName = (e) => {
        setInputName(e.target.value);
    };


    const Submit = (e) => {
        e.preventDefault();
        setName(inputName);
    };

    return (
        <>
            <div>
                <form onSubmit={Submit}>
                    <h1>Hello {name}</h1>
                    <input type="text" placeholder='Enter Your Name' onChange={InputName} value={inputName} />
                    <button type='submit'>Click Me</button>
                </form>
            </div>
        </>
    );
}

export default App;
